import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <div id="header">

          <nav>

            <ul class="active">
              <h1>YEARBOOK</h1>
              <li> <a href="#"> Help </a></li>
              <li> <a href="#"> Settings </a></li>
              <li> <a href="#"> Profile </a></li>
              <li> <a href="#"> Home </a></li>

            </ul>
          </nav>
        </div>
      </header>
    </div>
  );
}

export default App;
